import { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import axios from 'axios'; 

function UserDashboard() {
  const navigate = useNavigate();
  const [userChalets, setUserChalets] = useState([]);
  const [userData, setUserData] = useState({});
  const [loading, setLoading] = useState(true);
  const [activeTab, setActiveTab] = useState('dashboard');

  useEffect(() => {
    // Check if user is logged in
    const token = localStorage.getItem('token');
    const userId = localStorage.getItem('userId');
    
    if (!token || !userId) {
      navigate('/login');
      return;
    }

    // Fetch user data and their chalets
    const fetchUserData = async () => {
      try {
        setLoading(true);
        
        // Get user data
        const userResponse = await axios.get(`/api/users/${userId}`, {
          headers: { Authorization: `Bearer ${token}` }
        });
        
        setUserData(userResponse.data);
        
        // Get user's chalets
        const chaletsResponse = await axios.get(`/api/users/${userId}/chalets`, {
          headers: { Authorization: `Bearer ${token}` }
        });
        
        setUserChalets(chaletsResponse.data);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching data:', error);
        setLoading(false);
        // Handle unauthorized access
        if (error.response && error.response.status === 401) {
          navigate('/login');
        }
      }
    };

    fetchUserData();
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('userId');
    navigate('/login');
  };

  const formatPrice = (price) => {
    return new Intl.NumberFormat('en-US', {
      style: 'currency',
      currency: 'USD',
      minimumFractionDigits: 2
    }).format(price);
  };

  const formatDate = (dateString) => {
    const options = { 
      year: 'numeric', 
      month: 'long', 
      day: 'numeric',
      hour: '2-digit',
      minute: '2-digit'
    };
    return new Date(dateString).toLocaleDateString('en-US', options);
  };

  return (
    <div className="user-dashboard-container">
      <Navbar />
      <div className="user-dashboard">
        
        <aside className="user-sidebar">
          <div className="sidebar-header">
            <h2 className="sidebar-title">
              <span className="gradient-text">My</span> Dashboard
            </h2>
          </div>
          <nav className="sidebar-nav">
            <ul>
              <li>
                <a 
                  href="#dashboard" 
                  className={`nav-link ${activeTab === 'dashboard' ? 'active' : ''}`}
                  onClick={() => setActiveTab('dashboard')}
                >
                  <span className="nav-icon">📊</span>
                  <span className="nav-text">Dashboard</span>
                </a>
              </li>
              <li>
                <a 
                  href="#my-chalets" 
                  className={`nav-link ${activeTab === 'my-chalets' ? 'active' : ''}`}
                  onClick={() => setActiveTab('my-chalets')}
                >
                  <span className="nav-icon">🏠</span>
                  <span className="nav-text">My Chalets</span>
                </a>
              </li>
              <li>
                <a 
                  href="#bookings" 
                  className={`nav-link ${activeTab === 'bookings' ? 'active' : ''}`}
                  onClick={() => setActiveTab('bookings')}
                >
                  <span className="nav-icon">📅</span>
                  <span className="nav-text">Bookings</span>
                </a>
              </li>
              <li>
                <a 
                  href="#profile" 
                  className={`nav-link ${activeTab === 'profile' ? 'active' : ''}`}
                  onClick={() => setActiveTab('profile')}
                >
                  <span className="nav-icon">👤</span>
                  <span className="nav-text">Profile</span>
                </a>
              </li>
            </ul>
          </nav>
          <div className="sidebar-footer">
            <button 
              className="logout-btn"
              onClick={handleLogout}
            >
              <span className="nav-icon">🚪</span>
              <span className="nav-text">Logout</span>
            </button>
          </div>
        </aside>

        <main className="user-main">
          <header className="user-header">
            <div className="header-content">
              <h1 className="user-greeting">Welcome back, <span className="gradient-text">{userData.email?.split('@')[0] || 'User'}</span></h1>
              <p className="user-date">{new Date().toLocaleDateString('en-US', { weekday: 'long', year: 'numeric', month: 'long', day: 'numeric' })}</p>
            </div>
            <div className="user-actions">
              <button className="action-btn primary" onClick={() => navigate('/add-chalet')}>
                <span className="btn-icon">➕</span>
                <span className="btn-text">Add New Chalet</span>
              </button>
              <button className="action-btn secondary">
                <span className="btn-icon">🔔</span>
                <span className="btn-text">Notifications</span>
              </button>
            </div>
          </header>

          <div className="user-content">
            {loading ? (
              <div className="loading-container">
                <div className="loader"></div>
                <p>Loading your dashboard...</p>
              </div>
            ) : (
              <>
                {activeTab === 'dashboard' && (
                  <section id="dashboard" className="dashboard-section">
                    <div className="section-header">
                      <h2 className="section-title">Dashboard Overview</h2>
                      <p className="section-subtitle">Your chalet portfolio at a glance</p>
                    </div>
                    <div className="stats-grid">
                      <div className="stat-card">
                        <div className="stat-icon">🏠</div>
                        <div className="stat-value">{userChalets.length}</div>
                        <div className="stat-label">Total Chalets</div>
                      </div>
                      <div className="stat-card">
                        <div className="stat-icon">✅</div>
                        <div className="stat-value">
                          {userChalets.filter(chalet => chalet.status === 'Available').length}
                        </div>
                        <div className="stat-label">Available</div>
                      </div>
                      <div className="stat-card">
                        <div className="stat-icon">💰</div>
                        <div className="stat-value">
                          {formatPrice(userChalets.reduce((sum, chalet) => sum + parseFloat(chalet.price || 0), 0))}
                        </div>
                        <div className="stat-label">Total Value</div>
                      </div>
                      <div className="stat-card">
                        <div className="stat-icon">⭐</div>
                        <div className="stat-value">
                          {userChalets.length > 0 ? 
                            (userChalets.reduce((sum, chalet) => sum + parseFloat(chalet.rating || 0), 0) / userChalets.length).toFixed(1) : 
                            'N/A'}
                        </div>
                        <div className="stat-label">Avg. Rating</div>
                      </div>
                    </div>
                  </section>
                )}

                {activeTab === 'my-chalets' && (
                  <section id="my-chalets" className="dashboard-section">
                    <div className="section-header">
                      <h2 className="section-title">My Chalets</h2>
                      <p className="section-subtitle">Manage your property listings</p>
                    </div>
                    <div className="section-content">
                      {userChalets.length === 0 ? (
                        <div className="empty-state">
                          <div className="empty-icon">🏠</div>
                          <h3>No Chalets Found</h3>
                          <p>You don't have any chalets listed yet. Add your first property to get started!</p>
                          <button className="action-btn primary" onClick={() => navigate('/add-chalet')}>
                            Add New Chalet
                          </button>
                        </div>
                      ) : (
                        <div className="chalets-grid">
                          {userChalets.map(chalet => (
                            <div key={chalet.id} className="chalet-card">
                              <div className="chalet-image">
                                <img src={chalet.gallery_images || '/default-chalet.jpg'} alt={chalet.description} />
                                <div className="chalet-badge">{chalet.status}</div>
                              </div>
                              <div className="chalet-content">
                                <h3 className="chalet-title">{chalet.description}</h3>
                                <div className="chalet-location">
                                  <span className="location-icon">📍</span>
                                  <span>{chalet.city}, {chalet.canton}</span>
                                </div>
                                <div className="chalet-details">
                                  <div className="detail-item">
                                    <span className="detail-icon">🛏️</span>
                                    <span>{chalet.beds} Beds</span>
                                  </div>
                                  <div className="detail-item">
                                    <span className="detail-icon">🚿</span>
                                    <span>{chalet.bath} Baths</span>
                                  </div>
                                  <div className="detail-item">
                                    <span className="detail-icon">📏</span>
                                    <span>{chalet.sqft} sqft</span>
                                  </div>
                                </div>
                                <div className="chalet-price">
                                  <span className="price-value">{formatPrice(chalet.price)}</span>
                                </div>
                                <div className="chalet-updated">
                                  Last updated: {chalet.updated_at ? formatDate(chalet.updated_at) : 'N/A'}
                                </div>
                                <div className="chalet-actions">
                                  <button className="chalet-action edit" onClick={() => navigate(`/edit-chalet/${chalet.id}`)}>
                                    <span className="action-icon">✏️</span>
                                    <span>Edit</span>
                                  </button>
                                  <button className="chalet-action view" onClick={() => navigate(`/chalets/${chalet.id}`)}>
                                    <span className="action-icon">👁️</span>
                                    <span>View</span>
                                  </button>
                                </div>
                              </div>
                            </div>
                          ))}
                        </div>
                      )}
                    </div>
                  </section>
                )}

                {activeTab === 'bookings' && (
                  <section id="bookings" className="dashboard-section">
                    <div className="section-header">
                      <h2 className="section-title">Booking Requests</h2>
                      <p className="section-subtitle">Manage your property bookings</p>
                    </div>
                    <div className="section-content">
                      <div className="empty-state">
                        <div className="empty-icon">📅</div>
                        <h3>No Bookings Yet</h3>
                        <p>You don't have any booking requests at the moment.</p>
                      </div>
                    </div>
                  </section>
                )}

                {activeTab === 'profile' && (
                  <section id="profile" className="dashboard-section">
                    <div className="section-header">
                      <h2 className="section-title">Profile Settings</h2>
                      <p className="section-subtitle">Manage your account details</p>
                    </div>
                    <div className="section-content">
                      <div className="profile-form">
                        <div className="form-group">
                          <label htmlFor="email">Email Address</label>
                          <input 
                            type="email" 
                            id="email" 
                            value={userData.email || ''} 
                            readOnly 
                            className="form-control"
                          />
                        </div>
                        <div className="form-group">
                          <label htmlFor="created">Account Created</label>
                          <input 
                            type="text" 
                            id="created" 
                            value={userData.created_at ? formatDate(userData.created_at) : ''} 
                            readOnly 
                            className="form-control"
                          />
                        </div>
                        <div className="form-actions">
                          <button className="btn primary">Update Password</button>
                        </div>
                      </div>
                    </div>
                  </section>
                )}
              </>
            )}
          </div>
        </main>
        
      </div>
      <Footer />
    </div>
  );
}

export default UserDashboard;
